import "./App.css";
import React, { Component } from "react";

class App extends Component {
  state = {
    clients: [
      { id: 0, url: "%PUBLIC_URL%/img/img1.png", text: "Test 1" },
      { id: 1, url: "%PUBLIC_URL%/img/img2.png", text: "Test 2" },
      { id: 2, url: "%PUBLIC_URL%/img/img3.png", text: "Test 3" }
    ]
  };

  render() {
    return (
      <div>
        <Carousel itemsToShow={1}>
          <Item>{this.clients[0].text}</Item>
          <Item>{this.clients[1].text}</Item>
          <Item>{this.clients[2].text}</Item>
        </Carousel>
      </div>
    );
  }
}

export default App;
